int SocketTest()
{
    const char *msg = "{\"cityId\":\"QS23QmJgRm\",\"gameId\":\"1kgfRx-BgxAIQ\"}";
    TSBINARY binary, ts_id, body;
    int err;
    int sd;
    struct sockaddr_in sa;

    /* SSL 관련 정보를 관리할 구조체를 선언한다. */
    SSL_CTX   *ctx;
    SSL     *ssl;
    X509                    *server_cert;
    char                    *str;
    char                    buf[40960];

    /// encode_http_body
    ts_compress((_BYTE *)msg, (_DWORD)strlen(msg), &binary);
    encode_http_body(&binary, &ts_id, &body);

    /* 암호화 통신을 위한 초기화 작업을 수행한다. */
    SSL_load_error_strings();
    SSLeay_add_ssl_algorithms();
    ctx = SSL_CTX_new(TLS_method());
    CHK_NULL(ctx);

    /* Create a socket and connect to server using normal socket calls. */
    sd = socket(AF_INET, SOCK_STREAM, 0);
    CHK_ERR(sd, "socket");

//    int socket_fd;
//    struct sockaddr_in name;
//    struct hostent *hostinfo;
//
//    LOG_ENTER_FUNCTION();
//
//    // get host info. by domain.
//    if ( (hostinfo = gethostbyname( pstrTargetAddr ) ) == NULL )
//    {
//        LOGE("gethostbyname return : NULL" );
//        return -1 ;
//    }
//
//    // create socket
//    if ( (socket_fd = socket(AF_INET, SOCK_STREAM, 0 ) ) < 0 )
//    {
//        LOGE("Socket Create Failed. return : %d", socket_fd );
//        return -1;
//    }
//
//
    memset(&sa, 0x00, sizeof(sa));
    sa.sin_family = AF_INET;
    sa.sin_addr.s_addr = inet_addr("54.147.26.142");        // Server IP Address
    sa.sin_port = htons(443);                // Server Port Number

    err = connect(sd, (struct sockaddr*)&sa, sizeof(sa));
    CHK_ERR(err, "connect");

    /* Now we have TCP connection. Start SSL negotiation. */
    ssl = SSL_new(ctx);  // 세션을 위한 자원을 할당받는다.
    CHK_NULL(ssl);

    SSL_set_fd(ssl, sd);
    err = SSL_connect(ssl); // 기존의 connect() 함수 대신 사용하여 서버로 접속한다.
    CHK_NULL(err);

    /* Following two steps are optional and not required for data exchange to be successful. */

    /* Get the Cipher – opt */
    printf("SSL connection using %s\n", SSL_get_cipher(ssl));

    /* Get server's certificate (note: beware of dynamic allocation) – opt */
    /* 서버의 인증서를 받는다. */
    server_cert = SSL_get_peer_certificate(ssl);
    CHK_NULL(server_cert);
    printf("Server certificate:\n");

    /* 인증서의 이름을 출력한다. */
    str = X509_NAME_oneline(X509_get_subject_name(server_cert), 0, 0);
    CHK_NULL(str);
    printf("\t subject: %s\n", str);
    OPENSSL_free(str);

    /* 인증서의 issuer를 출력한다. */
    str = X509_NAME_oneline(X509_get_issuer_name(server_cert), 0, 0);
    CHK_NULL(str);
    printf("\t issuer: %s\n", str);
    OPENSSL_free(str);

    /* We could do all sorts of certificate verification stuff here before deallocating the certificate */
    X509_free(server_cert);


    char HEADERS[1024]={0,};
    sprintf( HEADERS,
            "POST /api/1/CheckCity?cityId=QS23QmJgRm HTTP/1.1\r\n"
            "Host: township.playrix.com\r\n"
            "Content-Type: application/octet-stream\r\n"
            "ts-bp: i\r\n"
            "ts-bver: 7.9.0\r\n"
            "ts-fver: 77\r\n"
            "ts-gpid: new\r\n"
            "ts-id: %s\r\n"
            "ts-token: 160ebbcadb73c7764d7ecf04cdda0e1e9e761de77b472315841917db02acc2af\r\n"
            "Content-Length: %d\r\n\r\n",
            ts_id.data(),
            (int)body.size()
        );
    //printf("%s", HEADERS);

    SSL_write(ssl, HEADERS,strlen(HEADERS));
    SSL_write(ssl, body.data(), body.size());
    CHK_SSL(err);

    int i ;
    int s, e ;
    bool is_header = true ;
    int content_length = 0 ;
    TSBINARY resp ;

    DumpAsPChar("Request Body", body);

    s = e = 0 ;
    err = SSL_read(ssl, buf, sizeof(buf) - 1);

    for ( i = 0 ; is_header ; i ++ )
    {
        if ( buf[i] == '\r' && buf[i+1] == '\n' )
        {
            if ( buf[ i + 2 ] == '\r' && buf[ i + 3 ] == '\n' )
            {
                is_header = false ;
                s = i+4 ;
                e = s + content_length ;
                break;
            }
            else
            {
                e = i-1;
                buf[i] = 0x00;
                printf("Header %2d : [%s]\n", i, buf+s);

                if ( strncasecmp((const char*)buf+s, "Content-Length" , 14 ) == 0 )
                {
                    sscanf(buf+s+16, "%d", &content_length);
                    printf("read content-length : %d\n", content_length);
                }
                s = i+2;
            }
        }
    }
    if ( s < err )
    {
        int remain = content_length - (err-s);
        do {
            resp.insert(resp.begin(), buf + s, buf + err);
            if ( remain <= 1 ) break;
            if ( remain < sizeof(buf) - 1 )
            {
                err = SSL_read(ssl, buf, remain);
                remain -= err ;
            }
            else
            {
                err = SSL_read(ssl, buf, sizeof(buf) - 1);
                remain -= err ;
            }
        } while ( true );
    }

    DumpAsPChar("Response Body", resp);
    CHK_SSL(err);
    SSL_shutdown(ssl);
    close(sd);
    SSL_free(ssl);
    SSL_CTX_free(ctx);


    return 0;
}

void dump_request(_BYTE *pKey, int lenKey, _BYTE *pRan, int lenRan, _BYTE *pBody, int lenBody, _BYTE *pBuffer, int lenBuffer, _BYTE *pDest, int lenDest)
{
    TSBINARY out ;
    ts_decompress(pBody, lenBody, &out);
    printf("Request : \n%s\n", out.data());
}
void dump_response(_BYTE *pKey, int lenKey, _BYTE *pRan, int lenRan, _BYTE *pBody, int lenBody, _BYTE *pBuffer, int lenBuffer, _BYTE *pDest, int lenDest)
{
    int i;
    TSBINARY ts_id;
    TSBINARY encoded_body(pBody, pBody + lenBody);
    TSBINARY compressed_body(pBuffer, pBuffer + lenBody) ;
    TSBINARY ret_uncompress;

    ts_id.resize( 3 + lenRan*2 + lenDest*2);
    ts_id[0] = '0';
    ts_id[1] = '0';
    ts_id[2] = '2';

#define C(x) ( (x) >= 0xA ? ( 'a' + (x) - 10 ) : ( '0' + (x) ) )
#define A1(x) C( ((x) >> 4) & 0xF )
#define A0(x) C( ((x) >> 0) & 0xF )

    for ( i = 0 ; i < lenRan ; i ++ )
    {
        ts_id[ 3 + i * 2 + 0 ] = A1(pRan[i]);
        ts_id[ 3 + i * 2 + 1 ] = A0(pRan[i]);
    }
    for ( i = 0 ; i < lenDest ; i ++ )
    {
        ts_id[ 3 + lenRan + i * 2 + 0 ] = A1(pDest[i]);
        ts_id[ 3 + lenRan + i * 2 + 1 ] = A0(pDest[i]);
    }

//    decode_http_body(
//        &encoded_body, &ts_id, &compressed_body
//    );
    ts_decompress(compressed_body.data(), compressed_body.size(), &ret_uncompress);

    printf("%s\n", ret_uncompress.data());
}

